import React, { Component } from 'react';
import './App.css';
import Hero from './Hero.js';
import Enemy from './Enemy.js';
import src from './logo.svg';
import empty from './empty.svg';
import amulet from './amulet.svg';
import head from './head.svg';
import ring from './ring.svg';
import shield from './shield.svg';
import armor from './armor.svg';
import sword from './sword.svg';
import belt from './belt.svg';
import boots from './boots.svg';
import gauntlet from './gauntlet.svg';

const items = [
    { name: "Amulet", zip: "1" , src},
    { name: "Head", zip: "1"  , src},
    { name: "Ring", zip: "1"  , src},
    { name: "LeftHand", zip: "1"  , src: shield},
    { name: "Armor", zip: "1"  , src},
    { name: "RightHand", zip: "1"  , src: sword},
    { name: "Belt", zip: "1"  , src},
    { name: "Boots", zip: "1"  , src},
    { name: "Gauntlels", zip: "1"  , src},
    { name: "Item1", zip: "1"  , src: empty},
    { name: "Item2", zip: "1"  , src: empty},
    { name: "Item3", zip: "1"  , src: empty},
];
const enemyItems = [
    { name: "Amulet", zip: "2" , src: amulet},
    { name: "Head", zip: "2"  , src: head},
    { name: "Ring", zip: "2"  , src: ring},
    { name: "LeftHand", zip: "2"  , src: shield},
    { name: "Armor", zip: "2"  , src: armor},
    { name: "RightHand", zip: "2"  , src: sword},
    { name: "Belt", zip: "2"  , src: belt},
    { name: "Boots", zip: "2"  , src: boots},
    { name: "Gauntlels", zip: "2"  , src: gauntlet},
    { name: "Item1", zip: "2"  , src: empty},
    { name: "Item2", zip: "2"  , src: empty},
    { name: "Item3", zip: "2"  , src: empty},
];

class App extends Component {
    render() {
        return (
            <div className="App">
                <Hero items={items}/>
                <Enemy items={enemyItems}/>
            </div>
        );
    }
}

export default App;
